import tempIcon from "../imgs/suny.svg";
import Humidity from "../imgs/humidity.png";
import Wind from "../imgs/wind.png";
const Card = () => {
    const [data, setData] = useState({
        celcius: '10',
        cityName: 'London',
        Humidity: '49%',
        Wind: '2km'
    })
    useEffect(() => {
      return () => {
        const APIUrl = 'https://api.openweathermap.org/data/2.5/weather?q=London&appid=844ef5767a95cfb4fbdfaf2fa243b192&units=metric'
        axios.get('APIUrl')
        .then(result => {
            setData({...data, celcius: result.data.main.temp, cityName: result.data.name, Humidity: result.data.main.Humidity, wind: result.data.wind.Wind})
        })

        .catch(error => console.log(error));
      };
    }, [input]);
  return (
    <div className="weatherCard">
      <div className="card-wrap">
        <div className="cityName">
          <h1>{data.cityName}</h1>
        </div>
        <div className="tempIcon">
          <img src={tempIcon} alt="icon" />
        </div>
        <div className="cityTemp">
          <h1>{data.celcius}Â°C</h1>
        </div>
        <div className="detail">
          <div className="tempDetail">
            <div className="detailImage">
              <img src={Humidity} alt="" srcset="" />
            </div>
            <div className="detailContent">
              <div className="detailValue">
                <h5>{data.humidity}</h5>
              </div>
              <detail className="detailName">
                <h5>Humidity</h5>
              </detail>
            </div>
          </div>
          <div className="tempDetail">
            <div className="detailImage">
              <img src={Wind} alt="" srcset="" />
            </div>
            <div className="detailContent">
              <div className="detailValue">
                <h5 id="noSpace">{data.wind}</h5>
              </div>
              <detail className="detailName">
                <h5>Wind</h5>
              </detail>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
